import React, { useState } from "react";
import axios from "axios";

function PreinscriptionForm() {
  const [parent, setParent] = useState({
    nomParent: "",
    prenomParent: "",
    tel: "",
    mail: "",
  });
  const [children, setChildren] = useState([
    { nomEnfant: "", prenomEnfant: "", dateNaissance: "" },
  ]);

  const handleParentChange = (e) => {
    setParent({ ...parent, [e.target.name]: e.target.value });
  };

  const handleChildChange = (e, index) => {
    const { name, value } = e.target;
    const updatedChildren = [...children];
    updatedChildren[index][name] = value;
    setChildren(updatedChildren);
  };

  const handleAddChild = () => {
    setChildren([...children, { nomEnfant: "", prenomEnfant: "", dateNaissance: "" }]);
  };

  const handleDeleteChild = (index) => {
    const updatedChildren = [...children];
    updatedChildren.splice(index, 1);
    setChildren(updatedChildren);
  };

 const handleSubmit = (e) => {
  e.preventDefault();
  axios
    .post("/addEnfantPreinscri", { parent, children })
    .then((response) => {
      console.log(response.data);
      // Handle successful response
    })
    .catch((error) => {
      console.error(error);
      // Handle error response
    });
};

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label htmlFor="nomParent">Parent Last Name:</label>
        <input
          type="text"
          id="nomParent"
          name="nomParent"
          value={parent.nomParent}
          onChange={handleParentChange}
        />
      </div>
      <div>
        <label htmlFor="prenomParent">Parent First Name:</label>
        <input
          type="text"
          id="prenomParent"
          name="prenomParent"
          value={parent.prenomParent}
          onChange={handleParentChange}
        />
      </div>
      <div>
        <label htmlFor="tel">Phone Number:</label>
        <input
          type="tel"
          id="tel"
          name="tel"
          value={parent.tel}
          onChange={handleParentChange}
        />
      </div>
      <div>
        <label htmlFor="mail">Email:</label>
        <input
          type="email"
          id="mail"
          name="mail"
          value={parent.mail}
          onChange={handleParentChange}
        />
      </div>
      {children.map((child, index) => (
        <div key={index}>
          <div>
            <label htmlFor={`nomEnfant-${index}`}>Child Last Name:</label>
            <input
              type="text"
              id={`nomEnfant-${index}`}
              name="nomEnfant"
              value={child.nomEnfant}
              onChange={(e) => handleChildChange(e, index)}
            />
          </div>
          <div>
            <label htmlFor={`prenomEnfant-${index}`}>Child First Name:</label>
            <input
              type="text"
              id={`prenomEnfant-${index}`}
              name="prenomEnfant"
              value={child.prenomEnfant}
              onChange={(e) => handleChildChange(e, index)}
            />
          </div>
          <div>
            <label htmlFor={`dateNaissance-${index}`}>Date of Birth:</label>
            <input
              type="date"
              id={`dateNaissance-${index}`}
              name="dateNaissance"
              value={child.dateNaissance}
              onChange={(e) => handleChildChange(e, index)}
            />
          </div>
          <button type="button" onClick={() => handleDeleteChild(index)}>
            Delete
          </button>
        </div>
      ))}
      <button type="button" onClick={handleAddChild}>
        Add Child
      </button>
      <button type="submit">Submit</button>
    </form>
  );
}

export default PreinscriptionForm;
